import React from "react";
import IconButton from "@mui/material/IconButton";
import DeleteIcon from "@mui/icons-material/Delete";
const ToDoList = (props) => {
  return (
    <>
      <li>
        {/* <button className="cancelBtn" onClick={()=>{props.onSelect(props.id);}}> + </button>  */}
        <IconButton aria-label="delete" onClick={()=>{props.onSelect(props.id);}}>
          <DeleteIcon />
        </IconButton>
        {props.text}
      </li>
    </>
  );
};
export default ToDoList;
